// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "erc721a/contracts/ERC721A.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract SwayBotFree is ERC721A, Ownable {
  constructor() ERC721A("Sway Bot Free", "SBF") {}

  uint256 MAX_MINTS = 5;
  uint256 MAX_SUPPLY = 255;
  bool public paused = false;

  string public baseURI = "ipfs://QmWmuzpLcbid4tfjoqgmtTjQKtbZCPHbxfLCUfRxnX6TGK/";

  function mint(uint256 quantity) external payable {
    require(!paused, "Contract is on pause");
    require((quantity + _numberMinted(msg.sender)) <= MAX_MINTS, "Exceeded the limit");
    require(totalSupply() + quantity <= MAX_SUPPLY, "Not enough token left");
    _safeMint(msg.sender, quantity);
  }

  function withdraw() external payable onlyOwner {
    payable(owner()).transfer(address(this).balance);
  }

  function _baseURI() internal view override returns (string memory) {
    return baseURI;
  }

  function pause(bool _state) public onlyOwner {
    paused = _state;
  }
}
